@notice Called by transactions to retry the sending of a cross-chain message.
@dev Retriggers the sending of a message previously emitted by sendCrossChainMessage that has not yet been acknowledged
with a receipt from the destination chain. This may be necessary in the unlikely event that less than the required
threshold of stake weight successfully inserted the message in their messages DB at the time of the first submission.
The message is checked to have already been previously submitted by comparing its message hash against those kept in
state until a receipt is received for the message.

@notice Adds the additional fee amount to the amount to be paid to the relayer that delivers
the given message ID to the destination chain.
@dev The fee token address must be the same asset type as the fee asset specified in the original
call to sendCrossChainMessage. Reverts if the message doesn't exist or there is already
receipt of delivery of the message.

@notice Receives a cross-chain message, and marks the `relayerRewardAddress` for fee reward for a successful delivery.
@dev The message specified by `messageIndex` must be provided at that index in the access list storage slots of the transaction,
and is verified in the precompile predicate.

@notice Retries the execution of a previously delivered message by verifying the payload matches
the hash of the payload originally delivered, and calling the destination address again.
@dev Intended to be used if message excution failed on initial delivery of the Teleporter message.
For example, this may occur if the original required gas limit was not sufficient for the message
execution, or if the destination address did not contain a contract, but a compatible contract
was later deployed to that address. Messages are ensured to be successfully executed at most once.

@notice Sends the receipts for the given `messageIDs`.
@dev Sends the specified message receipts in a new message (with an empty payload) back to the source chain.
This is intended for use in sending receipts that have not been sent in a timely manner by the standard
receipt delivery mechanism.
@return The message ID of the newly sent message.

@notice Returns the address the relayer reward should be sent to on the source chain
for a given message, assuming that the message has already been delivered.
@return The relayer reward address for the given message.

@notice Gets the fee token address and amount for a given sent message.
@return The fee token address and fee amount for a the given sent message ID.
If the message ID is not found, zero address and amount values are returned.

@notice Gets the message ID that would currently be used for the next message sent from the contract
instance to the given destination blockchain.
@dev This message ID may never be used in the event that the next call to sendCrossChainMessage in a
transaction uses a different destination blockchain. The current value as returned by this function will
change with each successful call to sendCrossChainMessage.
@return The specified message ID.

@dev Called by TeleporterMessenger on the receiving chain.
@param sourceBlockchainID is provided by the TeleporterMessenger contract.
@param originSenderAddress is provided by the TeleporterMessenger contract.
@param message is the TeleporterMessage payload set by the sender.

@dev ReceiptQueue is a convenience library that creates a queue-like interface of
TeleporterMessageReceipt structs. It provides FIFO properties.
Note: All functions in this library are internal so that the library is not deployed as a contract.
@custom:security-contact https://github.com/ava-labs/icm-contracts/blob/main/SECURITY.md

@dev Removes the oldest outstanding receipt from the queue.
Requirements:
- The queue must be non-empty.

@dev Implementation of the {ITeleporterMessenger} interface.
This implementation is used to send messages cross chain using the IWarpMessenger precompile,
and to receive messages sent from other chains. Teleporter contracts should be deployed through Nick's method
of universal deployer, such that the same contract is deployed at the same address on all chains.
@custom:security-contact https://github.com/ava-labs/icm-contracts/blob/main/SECURITY.md

@notice The blockchain ID of the chain the contract is deployed on.
@dev Can be initialized by calling initializeBlockchainID, or will be initialized
automatically on the first successful call to send or receive a message.

@notice A monotonically incremented integer tracking the total number of messages sent by this TeleporterMessenger contract.
@dev Used to provide uniqueness when generating message IDs for new messages. The first message sent will use a
messageNonce of 1 such that the nonce value can be used to provide replay protection for a given message ID.

@notice Tracks the outstanding receipts to send back to a given chain in subsequent messages sent to that chain.
@dev The key is the blockchain ID of the other chain, and the value is a queue of pending receipts for messages
received from that chain.

@notice Tracks the message hash and fee information for each message sent that has yet to be acknowledged
with a receipt.
@dev The key is the message ID, and the value is the info for the uniquely identified message.

@notice  Tracks the hash of messages that have been received but have never succeeded in execution.
@dev Enables retrying of failed messages with higher gas limits. Message execution is guaranteed to
succeed at most once. The key is the message ID, and the value is the hash of the uniquely
identified message whose execution failed.

@dev Tracks the message nonce for each message that has been received. The key is the message ID,
and the value is the nonce value that was received as a part of that message.
Note: the `messageNonce` values are also used to determine if a given message has been received or not.

@dev Tracks the reward amounts for a given asset able to be redeemed by a given relayer.
The first key is the relayer reward address, the second key is the fee token contract address,
and the value is the amount of the asset redeemable by the relayer.

@dev See {ITeleporterMessenger-sendCrossChainMessage}
When executed, a relayer may kick off an asynchronous event to have the validators of the
chain create an aggregate BLS signature of the message.
Emits a {SendCrossChainMessage} event when message successfully gets sent.

@dev Emits a {SendCrossChainMessage} event.
Requirements:
- `message` must have been previously sent.
- `message` encoding must match previously sent message.
@inheritdoc ITeleporterMessenger

@dev A Teleporter message has an associated `requiredGasLimit` that is used to execute the message.
If the `requiredGasLimit` is too low, then the message execution will fail. This method allows
for retrying the execution of a message with a higher gas limit. Contrary to `receiveCrossChainMessage`,
which will only use `requiredGasLimit` in the sub-call to execute the message, this method may
use all of the gas available in the transaction.
Reverts if the message execution fails again on the specified message.
Emits a {MessageExecuted} event if the retry is successful.
Requirements:
- `message` must have previously failed to execute, and matches the hash of the failed message.
@inheritdoc ITeleporterMessenger

@dev Requirements:
- `rewardAmount` must be non-zero.
@inheritdoc ITeleporterMessenger

@notice If not already set, initializes blockchainID by getting the current
blockchain ID value from the Warp precompile.
@dev Emits {BlockchainIDInitialized} event.
@return The current blockchain ID.

@dev Marks a message as being received by storing the message nonce associated with the
given message ID. The message nonce must not be zero in order to be able to distinguish between
received and unreceived messages based on their ID.

@dev Abstract contract that helps implement reentrancy guards between functions for sending and receiving.
Consecutive calls for sending functions should work together, same for receive functions, but recursive calls
should be detected as a reentrancy and revert.
Calls between send and receive functions should also be allowed, but not in the case it ends up being a recursive
send or receive call. For example the following should fail: send -> receive -> send.
@custom:security-contact https://github.com/ava-labs/icm-contracts/blob/main/SECURITY.md

@dev Emitted when `value` tokens are moved from one account (`from`) to
another (`to`).
Note that `value` may be zero.

@dev Moves a `value` amount of tokens from the caller's account to `to`.
Returns a boolean value indicating whether the operation succeeded.
Emits a {Transfer} event.

@dev Set the calling contract's allowance toward `spender` to `value`. If `token` returns no value,
non-reverting calls are assumed to be successful. Meant to be used with tokens that require the approval
to be set to zero before setting it to a non-zero value, such as USDT.

@dev Imitates a Solidity high-level call (i.e. a regular function call to a contract), relaxing the requirement
on the return value: the return value is optional (but if data is returned, it must not be false).
@param token The token targeted by the call.
@param data The call data (encoded using abi.encode or one of its variants).

@dev Imitates a Solidity high-level call (i.e. a regular function call to a contract), relaxing the requirement
on the return value: the return value is optional (but if data is returned, it must not be false).
@param token The token targeted by the call.
@param data The call data (encoded using abi.encode or one of its variants).
This is a variant of {_callOptionalReturn} that silents catches all reverts and returns a bool instead.

@dev Tool to verify that a low level call to smart-contract was successful, and reverts if the target
was not a contract or bubbling up the revert reason (falling back to {FailedInnerCall}) in case of an
unsuccessful call.

@dev Returns the ceiling of the division of two numbers.
This differs from standard division with `/` in that it rounds towards infinity instead
of rounding towards zero.

@notice Calculates floor(x * y / denominator) with full precision. Throws if result overflows a uint256 or
denominator == 0.
@dev Original credit to Remco Bloemen under MIT license (https://xn--2-umb.com/21/muldiv) with further edits by
Uniswap Labs also under MIT license.

@dev Returns the square root of a number. If the number is not a perfect square, the value is rounded
towards zero.
Inspired by Henry S. Warren, Jr.'s "Hacker's Delight" (Chapter 11).

@dev Return the log in base 256 of a positive value rounded towards zero.
Returns 0 if given 0.
Adding one to the result gives the number of pairs of hex symbols needed to represent `value` as a hex string.
